- input: "TEXT\x1CC00010082\x1C1\x1C\x1CF3XN\x1CNCTA PAC made a disbursement $5000
    to Spratt for Congress on 3/17/2010. Another check in the same amount had been
    cut on 3/10/2010 to an unrelated campaign committee. These two checks were mailed
    separately to the same address - a fundraising company that the two committees
    happen to share. The fundraising company mistakenly forwarded both checks to the
    Spratt for Congress Committee. When Spratt for Congress Committee recognized the
    mistake, they refunded the $5000 they had deposited in error.  NCTA PAC did not
    disburse excess funds to the Spratt for Congress Committee; our report reflects
    a deposit error beyond our control. \n"
